) Dong Jiahong, executive president of Beijing's Tsinghua Changgung Hospital and former head of the Chinese People’s Liberation Army General Hospital, has been disinvited from the Israel-China Hi-Tech Investments Summit, following complaints about his suspected participation in forced organ harvesting of Chinese prisoners of conscience.

The high-profile conference, organized by the Chinese and Israeli governments, is being held in Haifa, Israel’s third-largest city, between November 18 and 20, 2018. As with the six previous summits, participants include Chinese ambassadorial staff in Israel and officials from the local Haifa and Israeli government, as well as experts and entrepreneurs in the fields of life science, cyber security, and artificial intelligence.

Dong planned to attend the conference as a medical specialist, but the Haifa Economic Cooperation (HEC) withdrew his invitation because of pressure from the International Coalition to End Transplant Abuse in China (ETAC) and other groups. ETAC is a worldwide coalition of lawyers, academics, ethicists, medical professionals, researchers and human-rights advocates dedicated to end forced organ harvesting in China.
